import React, { useState, useEffect } from 'react';
import axios from 'axios';
import StatCard from './StatCard';

const WeeklyPerformance = () => {
  const [weeklyData, setWeeklyData] = useState({});

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await axios.get('/api/summary/weekly');
        setWeeklyData(response.data);
      } catch (error) {
        console.error(error);
      }
    };

    fetchData();
  }, []);

  return (
    <div>
      <h2>Weekly Performance</h2>
      <div className="stat-cards">
        <StatCard title="Net Profit" value={weeklyData.netProfit} />
        <StatCard title="Gross Earnings" value={weeklyData.grossEarnings} />
        <StatCard title="Expenses" value={weeklyData.expenses} />
        <StatCard title="Mileage" value={weeklyData.mileage} />
      </div>
    </div>
  );
};

export default WeeklyPerformance;
